import Button from 'react-bootstrap/Button';

const HasNoParty = ({ member }) => {
    return (
        <div style={{display: 'flex', justifyContent: 'center', alignItems: 'center', flexDirection: 'column'}} className='content section'>

            <h4 className='title'>What do you want to do?</h4>
            <div className='button-group'>
                <Button variant='primary'>Host Party</Button>
                <Button variant='primary'>Join Party</Button>
            </div>

        </div>
    )   
}

export default HasNoParty;
